description:
And a threefold cord is not quickly broken.  Ecclesiastes 4:12
Religion is as a golden cord that binds the souls of both youth and aged to Christ. Through it the willing and obedient are brought safely through dark and intricate paths to the city of God. {MYP 30.2}  
Christ draws human beings to Himself with the cord which God has let down from heaven to save the race. The love of Christ can be measured only when this cord is measured. {CH 534.1}  
And the truth must bind us together like strong cords in order that no distracted efforts may be witnessed among the workers.  {TM 228.2}
